public class OddEvenMod
{
    public static void main(String[] args)
    {
        int[] arr = {8,7,7,3,4,1};
        for (int i = 0; i < arr.length; i++)
        {
            if(arr[i] % 2 == 0)
            {
                int temp = arr[0];
                arr[0] = arr[i];
                arr[i] = temp;
            }
        }
        for (int t = 0; t < arr.length; t++)
        {
            System.out.print((arr[t]) + ",");
        }
    }
}

